import React from "react";
import "./App.css";
import "semantic-ui-css/semantic.min.css";
import NavBar from "./pages/NavBar";
import Content from "./pages/Content";
import Footer from "./pages/Footer";

function App() {
  return (
    <div>
      <NavBar />
      <div className="row">
        <Content />
      </div>
      <Footer />
    </div>
  );
}

export default App;
